import React from 'react';
import { Link } from 'react-router-dom';

export const links = [
    {
        name: 'My account',
        linkTo: '/dashboard'
    },
    {
        name: 'User Information',
        linkTo: '/dashboard/user/user_info'
    },
    {
        name: 'My cart',
        linkTo: '/dashboard/user/user_cart'
    }
];

export const liadminnks = [
    {
        name: 'Products',
        linkTo: '/dashboard/admin/admin_products'
    },
    {
        name: 'Manage site',
        linkTo: '/dashboard/admin/manage_site'
    }
];

const DashboardLayout = (props) => {

    const generateLinks = () => (
        links.map((item, i) => (
            <Link to={item.linkTo} key={`${links.name}${i}`}>
                {item.name}
            </Link>
        ))
    )

    return (
        <div className='container'>
            <div className='user_container page_container'>
                <div className='user_left_nav'>
                    <h2>My Account</h2>
                    <div className='links'>
                        { generateLinks() }
                    </div>
                </div>
            </div>
        </div>
    )
}

export default DashboardLayout;
